import Link from 'next/link'
import styled from 'styled-components'
import styles from './NavBar.module.scss'


const TopWrapper = styled.nav`
  display: flex;
  height: 80px;
  background: rgba(0, 0, 0, 0);
  
  a {
    

    color: #FFF;
    padding: 10px 30px;
    text-align: center;
    text-decoration: none;
    
  }
  a:hover {
    background-color:#A9A9A9;
  }
  `

const Nav = () => (
  <div >

    <div className={styles.topFixed}>
  <TopWrapper>
  <h2 className={styles.h3}>yuhangang</h2>
  </TopWrapper>
  </div>
  <div className={styles.sticky}>
  <div className={styles.secondBar}>
    <Link href='/'><div className={styles.secondBarButtons}>Home</div></Link> 
    <Link href='/about' prefetch><div className={styles.secondBarButtons}>About</div></Link> 
    <Link href='/contact' prefetch><div className={styles.secondBarButtons}>Contact</div></Link>
  </div>
  </div>
  
  
  </div>
)

export default Nav;
